import React from 'react'
import classes from './Cart.module.css'

const Cart = () => {
  return (
    <div className={classes.Cart}>
      <div className={classes.Icon}>
        <img />
      </div>
      <button>去结算</button>
    </div>
  )
}

export default Cart
